import React from "react";
import Header from "../../components/Header";
import css from "./index.module.scss";
function Home() {
  return (
    <React.Fragment>
      <Header selectedPage={"home"} />
      <div className={css.root}></div>
    </React.Fragment>
  );
}

export default Home;
